import React, { useEffect, useState } from "react";
import axios from "axios";
import Log from "./Log";
import { Routes, Route, useLocation } from "react-router-dom";
import Nav from "./Nav";
import Home from "./Home";
import Bgmi from "./Bgmi";
import FF from "./FF";
import Pr from "./Pr";
import Um from "./Um";
import Wit from "./Wit";
import Dep from "./Dep";
import Result from "./Result";
import Bsolo1r from "./Bsolo1r";
import Bsolo2r from "./Bsolo2r";
import Bsquadr from "./Bsquadr";
import Fsolo1r from "./Fsolo1r";
import Fsolo2r from "./Fsolo2r";
import Fsquadr from "./Fsquadr";
import Load from "./Load";
import Help from "./Help";
import Pnf from "./Pnf";
import Fp from "./Fp";
function App() {
  const [BS1, SETBS1] = useState([]);
  const [BS2, SETBS2] = useState([]);
  const [BSD, SETBSD] = useState([]);
  const [FS1, SETFS1] = useState([]);
  const [FS2, SETFS2] = useState([]);
  const [FSD, SETFSD] = useState([]);
  useEffect(() => {
    const md = async () => {
      await axios.post("http://localhost:4000/md").then((res) => {
        SETBS1(res.data.bs1);
        SETBS2(res.data.bs1);
        SETBSD(res.data.bs1);
        SETFS1(res.data.bs1);
        SETFS2(res.data.bs1);
        SETFSD(res.data.bs1);
      });
    };
    md();
  }, []);
  const location = useLocation();
  const rn = location.pathname !== "/";
  const bs1 = {
    type: BS1[0],
    map: BS1[1],
    date: BS1[2],
    time: BS1[3],
    w: BS1[4],
    r: BS1[5],
    k: BS1[6],
  };
  const bs2 = {
    type: BS2[0],
    map: BS2[1],
    date: BS2[2],
    time: BS2[3],
    w: BS2[4],
    r: BS2[5],
    k: BS2[6],
  };
  const bsd = {
    type: BSD[0],
    map: BSD[1],
    date: BSD[2],
    time: BSD[3],
    w: BSD[4],
    r: BSD[5],
    k: BSD[6],
  };
  const fs1 = {
    type: FS1[0],
    map: FS1[1],
    date: FS1[2],
    time: FS1[3],
    w: FS1[4],
    r: FS1[5],
    k: FS1[6],
  };
  const fs2 = {
    type: FS2[0],
    map: FS2[1],
    date: FS2[2],
    time: FS2[3],
    w: FS2[4],
    r: FS2[5],
    k: FS2[6],
  };
  const fsd = {
    type: FSD[0],
    map: FSD[1],
    date: FSD[2],
    time: FSD[3],
    w: FSD[4],
    r: FSD[5],
    k: FSD[6],
  };
  const bs1r = {
    name: "BGMI",
    type: "SOLO",
    map: "ERANGLE",
    date: "01/01/2003",
    time: "10:00 am",
    display: "flex",
  };
  const bs2r = {
    name: "BGMI",
    type: "SOLO",
    map: "ERANGLE",
    date: "01/01/2003",
    time: "11:00 am",
    display: "none",
  };
  const bsdr = {
    name: "BGMI",
    type: "SQUAD",
    map: "ERANGLE",
    date: "01/01/2003",
    time: "12:00 am",
    display: "none",
  };
  const fs1r = {
    name: "FREE FIRE",
    type: "SOLO",
    map: "BERMUDA",
    date: "01/01/2003",
    time: "10:00 am",
    display: "none",
  };
  const fs2r = {
    name: "FREE FIRE",
    type: "SOLO",
    map: "BERMUDA",
    date: "01/01/2003",
    time: "11:00 am",
    display: "none",
  };
  const fsdr = {
    name: "FREE FIRE",
    type: "SQUAD",
    map: "BERMUDA",
    date: "01/01/2003",
    time: "12:00 am",
    display: "none",
  };
  return (
    <>
      {rn && <Nav />}
      <Routes>
        <Route path="/" element={<Log />}></Route>
        <Route path="/loading" element={<Load />}></Route>
        <Route element={<Pr />}>
          <Route path="/home" element={<Home />}></Route>
          <Route
            path="/bgmi"
            element={<Bgmi bs1={bs1} bs2={bs2} bsd={bsd} />}
          ></Route>
          <Route
            path="/ff"
            element={<FF fs1={fs1} fs2={fs2} fsd={fsd} />}
          ></Route>
          <Route
            path="/um"
            element={
              <Um bs1={bs1} bs2={bs2} bsd={bsd} fs1={fs1} fs2={fs2} fsd={fsd} />
            }
          ></Route>
          <Route
            path="/result"
            element={
              <Result
                bs1={bs1r}
                bs2={bs2r}
                bsd={bsdr}
                fs1={fs1r}
                fs2={fs2r}
                fsd={fsdr}
              />
            }
          ></Route>
          <Route path="/bsolo1r" element={<Bsolo1r bs1={bs1} />}></Route>
          <Route path="/bsolo2r" element={<Bsolo2r bs2={bs2} />}></Route>
          <Route path="/bsquadr" element={<Bsquadr bsd={bsd} />}></Route>
          <Route path="/fsolo1r" element={<Fsolo1r fs1={fs1} />}></Route>
          <Route path="/fsolo2r" element={<Fsolo2r fs2={fs2} />}></Route>
          <Route path="/fsquadr" element={<Fsquadr fsd={fsd} />}></Route>
          <Route path="/deposit" element={<Dep />}></Route>
          <Route path="/withdraw" element={<Wit />}></Route>
          <Route path="/helpline" element={<Help />}></Route>
        </Route>
        <Route path="/fp" element={<Fp />}></Route>
        <Route path="/*" element={<Pnf />}></Route>
      </Routes>
    </>
  );
}
export default App;
